var map;
function initMap() {
	map = new google.maps.Map(document.getElementById('all_map'), {
	  zoom: 1,
	  center: {lat: 0, lng: 151.196123},
	  mapTypeId: 'terrain'
	});


	var heatmapData = [];

	for (var i = 0; i < all_coords.length; i++) {
	  var latLng = new google.maps.LatLng(all_coords[i]["latitude"], all_coords[i]["longitude"]);

	  var magnitude = all_coords[i]["count"];
	  var weightedLoc = {
	    location: latLng,
	    weight: Math.pow(1.02, magnitude)
	  };
	  heatmapData.push(weightedLoc);
	}

	var heatmap = new google.maps.visualization.HeatmapLayer({
	  data: heatmapData,
	  dissipating: false,
	  map: map
	});
}

